import axios from "axios";
import React, { useState } from "react";

const Home = () => {
  const [futurasMarcacoes, setFuturasMarcacoes] = useState({ marcacoes: [] });

  axios.get("http://localhost:5000/marcacoes").then((res) => {
    const marcacoes = res.data;
    setFuturasMarcacoes([...futurasMarcacoes, marcacoes]);
  });

  return (
    <>
      <h2>Home</h2>
    </>
  );
};

export default Home;
